import React from 'react';
import { Link } from 'react-router-dom' 


function About(props) {
  return (
    <div > 
        <h1> About</h1>    
           <ul className="App-header">
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About Us</Link>
              </li>
              <li>
                <Link to="/contact">Contact Us</Link>
              </li> 
            </ul>  
     </div>
  );
}

export default About;
